```
db.payers.aggregate([
    {
        $match: {
            "PAYER_ID": "e03e23c9-4df1-3eb6-a62d-f70f02301496"
        }
    },
    {
        $lookup: {
            from: "CLAIMS",
            localField: "PAYER_ID",
            foreignField: "PRIMARY_PATIENT_INSURANCE_REF",
            as: "claims"
        }
    },
    {
        $unwind: "$claims"
    },
    {
        $group: {
            _id: "$claims.DEPARTMENT_ID",
            revenue: { $sum: "$claims.HEALTHCARE_CLAIM_TYPE_ID_1" }
        }
    },
    {
        $project: {
            _id: 0,
            revenue: { $if: [{ $gt: ["$revenue", 0] }, "$revenue", 0] }
        }
    }
])
```

